import React from 'react';

const BtnDestruc = props => {

    const { word } = props;

    const destr = (word) =>{
        for (let i = 0; i < word.length; i++) {
            console.log(word[i])
            word[i].style.transform = `translateY(${Math.floor(Math.random()* 5 + -3)}rem)`;
        }
    }

    return (

        <div>
            {destr(word)}
        </div>
    );
}

export default BtnDestruc;
